import { App, Plugin } from 'obsidian';

interface MyPluginSettings {
	mySetting: string;
}

const DEFAULT_SETTINGS: MyPluginSettings = {
	mySetting: 'default'
}

export default class MyPlugin extends Plugin {
	settings: MyPluginSettings;

	async onload() {
		await this.loadSettings();

		// Listen for click events on the entire document
		this.registerDomEvent(document, 'click', (evt: MouseEvent) => this.handleClick(evt));
	}

	onunload() {

	}

	async loadSettings() {
		this.settings = Object.assign({}, DEFAULT_SETTINGS, await this.loadData());
	}

	async saveSettings() {
		await this.saveData(this.settings);
	}

	handleClick(evt: MouseEvent) {
		// Check if the clicked element is a checkbox
		let target = evt.target as HTMLInputElement;
		if (target.tagName === 'INPUT' && target.type === 'checkbox') {
			// Play different sound based on whether the checkbox is checked or not
			if (target.checked) {
				this.playSound('data:audio/mp3;base64,');
			} else {
				this.playSound('data:audio/mp3;base64,');
			}
		}
	}
	
	playSound(soundData: string) {
		// Play the sound
		let audio = new Audio(soundData);
		audio.play();
	}
}
